import React, { useEffect, useState } from "react";
import axios from "../api/axios";
const Main = () => {
  const [event, setEvent] = useState([]);
  useEffect(() => {
    (async () =>
      axios
        .get("/event")
        .then((response) => {
          setEvent(response.data);
          console.log(event);
        })
        .catch())();
  }, []);
  return <div></div>;
};

export default Main;
